        function countPrimes(n) {
            if(n==0||n==1) return 0
            //计数
            var count=0
            for(let i=2;i<n;i++){
               //判断是否是质数
                for (let j=2;j<i;j++){
                    if (i%j==0){
                        count++
                        break
                    }
                }
            }
        return count
